import Table from "react-bootstrap/Table";
import React from "react";

 const TableView=({tableData})=>{

    return (
        <>
            <Table striped bordered hover>
                <thead>
                <tr>
                    <td>Countries</td>
                    <td>Emoji</td>
                    <td>Capital</td>
                    <td>Currency</td>
                </tr>
                </thead>
                <tbody>
                {tableData.map((data) => {
                    return (
                    <tr>
                        <td>{data.name}</td>
                        <td>{data.emoji}</td>
                        <td>{data.capital}</td>
                        <td>{data.currency}</td>
                    </tr>
                    );
                })}
                </tbody>
            </Table>
        </>
        )
 }


 export default TableView
